/**
 * Build lookup maps and validate integrity.
 * Usage:
 *   import { RANKINGS, buildIndex } from "./preflop_rankings_169.js";
 *   const { byCards, byRank } = buildIndex(RANKINGS);
 */
export function buildIndex(rankings) {
  const byCards = new Map();
  const byRank = new Map();

  for (const row of rankings) {
    if (!row || typeof row !== "object") throw new Error("Bad row: " + String(row));
    const cards = String(row["Cards"] ?? "").trim();
    const rank = Number(row["Rank"]);
    if (!cards) throw new Error("Missing Cards in row: " + JSON.stringify(row));
    if (!Number.isInteger(rank)) throw new Error("Bad Rank for " + cards + ": " + String(row["Rank"]));

    if (byCards.has(cards)) throw new Error("Duplicate Cards: " + cards);
    if (byRank.has(rank)) throw new Error("Duplicate Rank: " + rank);

    byCards.set(cards, row);
    byRank.set(rank, row);
  }

  // Validate rank range 1..169
  for (let r = 1; r <= 169; r++) {
    if (!byRank.has(r)) throw new Error("Missing rank: " + r);
  }
  if (byCards.size !== 169) throw new Error("Expected 169 hands, got " + byCards.size);

  // Validate the canonical 169-hand key set
  const ranks = ["A","K","Q","J","T","9","8","7","6","5","4","3","2"];
  const expected = new Set();
  for (let i = 0; i < ranks.length; i++) {
    for (let j = i; j < ranks.length; j++) {
      const a = ranks[i], b = ranks[j];
      if (a === b) expected.add(a + b);
      else {
        expected.add(a + b + "s");
        expected.add(a + b + "o");
      }
    }
  }
  for (const key of expected) {
    if (!byCards.has(key)) throw new Error("Missing hand key: " + key);
  }
  for (const key of byCards.keys()) {
    if (!expected.has(key)) throw new Error("Unexpected hand key: " + key);
  }

  return { byCards, byRank };
}
